import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './Table/navbar';
import Login from './Table/helloworld';
import Wilaya from './Table/wilaya';
import { AuthProvider } from './session';
import './App.css';
import Home from './Table/home';
import PrivateRoute from './'; // Import du composant PrivateRoute
import RegisterForm from './Table/register';
import UserProfile from './Table/profile';
import FormulaireDepistage from './Table/testdon';
import Table from './Table/tabledon';
import NavBar2 from './Table/NavBar2';

function App() {
  return (
    <Router>
      <AuthProvider>
        <Navbar />
        <div>
          <div className="mt-20"></div>
          <Routes>
            <PrivateRoute path="/wilaya">
              <Wilaya />
            </PrivateRoute>
            <Route path="/login" element={<Login />} />
            <Route path="/" element={<Home />} />
            <Route path="/register" element={<RegisterForm />} />
            <Route path="/profile" element={<UserProfile />} />
            <Route path="/test" element={<FormulaireDepistage />} />
            <Route path="/don" element={<Table />} />
            <Route path="/navbar2" element={<NavBar2 />} />
          </Routes>
        </div>
      </AuthProvider>
    </Router>
  );
}

export default App;
